import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

function App() {
    return ( 
        <div className="App">
            <header className = "App-header">
                <p>
                This is how react app works 
                </p> 
            </header>

            <div className = "App-body">
                <a href = 'reactjs.org' > You can read documentation by clicking me </a> 
            </div> 
        </div>
    );
}

export default App;
